import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to the user profile page by clicking "Your Profile" link
    // Use first occurrence (since there are multiple)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    await profileLink.click();

    // Wait for profile header to appear (profile-page or profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    // Full Name
    const fullName = await page.$eval('.profile-header .profile-info h2', el => el.textContent.trim());
    // Username
    const username = await page.$eval('.profile-header .profile-info .username', el => el.textContent.trim());
    // Bio
    const bio = await page.$eval('.profile-header .profile-info .bio', el => el.textContent.trim());
    // Profile Image
    const profileImage = await page.$eval('.profile-header .profile-image', el => el.getAttribute('src'));
    // Stats
    const stats = await page.$$eval('.profile-header .profile-stats .stat', nodes => nodes.map(node => ({
      number: node.querySelector('.stat-number')?.textContent.trim(),
      label: node.querySelector('.stat-label')?.textContent.trim()
    })));

    // Extract Jun's recent reviews (titles and ratings)
    const reviews = await page.$$eval('.reviews-list .review-item', nodes =>
      nodes.map(node => ({
        product: node.querySelector('.review-product-title')?.textContent.trim(),
        rating: node.querySelector('.stars')?.textContent.trim(),
        title: node.querySelector('.review-title')?.textContent.replace(/"/g, '').trim(),
        content: node.querySelector('.review-content')?.textContent.trim(),
        date: node.querySelector('.review-date')?.textContent.trim()
      }))
    );

    // Extract Jun's products (titles and prices)
    const products = await page.$$eval('.profile-sections .section:first-child .product-card', nodes =>
      nodes.map(node => ({
        title: node.querySelector('.product-title')?.textContent.trim(),
        price: node.querySelector('.product-price')?.textContent.replace(/\s+/g, ' ').trim()
      }))
    );

    return {
      success: true,
      action: "Harvested user profile information: name, username, bio, image, stats, reviews, and products.",
      extractedData: {
        fullName,
        username,
        bio,
        profileImage,
        stats,
        reviews,
        products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
